import React, { useRef } from "react";
import "./styles.module.css";

const Dropdown = (props) => {

  return (
    <>
    <div id="menu-wrap">
        <div class="dots">
          <div></div>
        </div>
        <div class="menu">
            <div>
                <ul>
                    <li><a href="#" class="link">Edit</a></li>
                    <li><a href="#" class="link">Delete</a></li>
                </ul>
            </div>
        </div>
    </div>
    </>
  );
};

export default Dropdown;
